function maxProduct(nums) {
    let i = nums[0] > nums[1] ? 0 : 1;
    let j = 1 - i;
    for (let k = 2; k < nums.length; k++) {
        if (nums[k] > nums[i]) {
            j = i;
            i = k;
        } else if (nums[k] > nums[j]) {
